import React, { useState } from "react";
import { Link } from "react-router-dom";

import './Nav.module.scss';

import hamburger_icon from '../../assets/icon-hamburger.svg';
import close_icon from '../../assets/icon-close.svg';
import arrow_icon from '../../assets/icon-chevron.svg';

import mercury_icon from '../../assets/planet-mercury.svg';
import venus_icon from '../../assets/planet-venus.svg';
import earth_icon from '../../assets/planet-earth.svg';
import mars_icon from '../../assets/planet-mars.svg';
import jupiter_icon from '../../assets/planet-jupiter.svg';
import saturn_icon from '../../assets/planet-saturn.svg';
import uranus_icon from '../../assets/planet-uranus.svg';
import neptune_icon from '../../assets/planet-neptune.svg';


function Nav() {

   const [menuOpen, setMenuOpen] = useState(false);

   const toggleMenu = () => {
     setMenuOpen(!menuOpen);
   };

  return (
    <nav className="navigation">
      <h2 className="navigation_title">The planets</h2>
      <img
        src={menuOpen ? close_icon : hamburger_icon}
        alt="menu_icon"
        onClick={toggleMenu}
        className="navigation_menu_icon"
      />
      <div className={`list ${menuOpen ? "list_open" : "list_closed"}`}>
        {" "}
        <Link to="/" className="list_element">
          <img className="list_element_icon" alt="planet_icon" />
          <p>Home</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/mercury" className="list_element">
          <img
            className="list_element_icon"
            src={mercury_icon}
            alt="planet_icon"
          />
          <p className="list_element_text">Mercury</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/venus" className="list_element">
          <img
            className="list_element_icon"
            src={venus_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Venus</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/earth" className="list_element">
          <img
            className="list_element_icon"
            src={earth_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Earth</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/mars" className="list_element">
          <img
            className="list_element_icon"
            src={mars_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Mars</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/jupiter" className="list_element">
          <img
            className="list_element_icon"
            src={jupiter_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Jupiter</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/saturn" className="list_element">
          <img
            className="list_element_icon"
            src={saturn_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Saturn</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/uranus" className="list_element">
          <img
            className="list_element_icon"
            src={uranus_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Uranus</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
        <Link to="/neptune" className="list_element">
          <img
            className="list_element_icon"
            src={neptune_icon}
            alt="planet_icon"
          />
          <p className="navigation_list_element">Neptune</p>
          <img
            src={arrow_icon}
            alt="arrow_icon"
            className="list_element_icon_arrow"
          />
        </Link>
      </div>
    </nav>
  );
};

export default Nav;
